  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108080 includes chemical,
  discrete sample, physical and profile data collected from MELVILLE in the North
  Pacific Ocean and Philippine Sea from 2004-06-15 to 2004-08-27 and retrieved during
  cruise 318M200406. These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Chromophoric Dissolved
  Organic Matter (CDOM), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED
  INORGANIC CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC
  PRESSURE, NEON, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE, TRITIUM and WATER
  TEMPERATURE. The instruments used to collect these data include Alkalinity titrator,
  CTD, Coulometer for DIC measurement and bottle. These data were collected by Dennis
  Hansell of Rosenstiel School of Marine and Atmospheric Science, Andrew Dickson of
  Scripps Institution of Oceanography and Richard A. Feely of US DOC; NOAA; OAR; Pacific
  Marine Environmental Laboratory as part of the CLIVAR_P02_2004 data set.nnThe International
  CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries out a systematic
  and global re-occupation of select WOCE/JGOFS hydrographic sections to quantify
  changes in storage and transport of heat, fresh water, carbon dioxide (CO2), and
  related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
